import React from "react";
import { Basic } from "react-dial-knob";
import io from 'socket.io-client';
import AngleDial from './AngleDial.js'

// You can try Basic, White, Silver or HighContrast skins

const socket = io();

class Agent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      agent_id: props.agent_id,
      cur_pos: props.cur_pos,
      cur_angle: props.cur_angle,
      color: props.color
    };
  }


  render() {

  return (
            <div>
              <AngleDial value={this.state.cur_angle} id={this.state.agent_id} />

              <ol key={ this.state.agent_id}>
                  agent_id: {this.state.agent_id},
                  cur_angle: {this.state.cur_angle},
                  cur_pos: {this.state.cur_pos},
                  color: {this.state.color}
              </ol>
            </div>

        );
    }
}


export default Agent;
